import React from 'react'

function nav() {


    function logOut(){
        window.localStorage.clear();
        return "done";
    }



    return (
        <div className = "nav">
            <ul className = "nav-ul">
                <li>
                    <a href="/home">home</a>      
                </li>
                <li>
                    <a href="/calanderView">Calander view</a>
                </li>
                <li>
                    <a href="/myAccount">my account</a>      
                </li>
                <li>
                    <a href="/login" onclick={window.localStorage.clear()}>log out</a>
                </li>
            </ul>
        </div>

    )
}

export default nav
